    false,nt"url": null,nt"notes": "NODC Accession 0115710 includes chemical,
    meteorological, physical and underway - surface data collected from NOAA Ship Bell
    M. Shimada in the Coastal Waters of SE Alaska, Cordell Bank National Marine Sanctuary,
    Gulf of the Farallones National Marine Sanctuary, Monterey Bay National Marine Sanctuary,
    North Pacific Ocean and Olympic Coast National Marine Sanctuary from 2011-06-27
    to 2011-08-31 and retrieved during cruise 332220110627, 332220110716, 332220110802
    and 332220110820. These data include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY)
    OF CARBON DIOXIDE, BAROMETRIC PRESSURE, CARBON DIOXIDE - AIR, Partial pressure (or
    fugacity) of carbon dioxide, SALINITY and SEA SURFACE TEMPERATURE. The instruments
    used to collect these data include Barometric pressure sensor, Carbon dioxide (CO2)
    gas analyzer, Shower head chamber equilibrator for autonomous carbon dioxide (CO2)
    measurement and thermosalinographs. These data were collected by Catherine E. Cosca,
    Richard A. Feely, Simone R. Alin and Geoffrey T. Lebon of US DOC; NOAA; OAR; Pacific
    Marine Environmental Laboratory as part of the VOS_Bell_Shimada_SH1103_L1, VOS_Bell_Shimada_SH1103_L2,
    VOS_Bell_Shimada_SH1103_L3 and VOS_Bell_Shimada_SH1103_L4 data set.nnThe Global
    Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
    Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
    have been outfitting research ships and commercial vessels with automated CO2 sampling
    equipment to analyze the carbon exchange between the ocean and atmosphere.",nt"owner_org":
